import React, { Component } from "react";
import "./News.css";

class News extends Component {
  render() {
    return (
      <div className="news">

        <div className="news-top">
          <div className="news-top-first-title">Erik Vardanyan</div>
          <div className="news-top-second-title">NEWS LETTER</div>
        </div>

        <div className="news-date">Date: August 19, 2018.</div>

        <div className="news-content">

          <div className="news-content-left">
            <div className="news-content-left-text">lorem ipsum</div>
            <img
              className="news-content-left-pic"
              alt="news-content-left-pic"
            />
          </div>

          <div className="news-content-right" />
        </div>
      </div>
    );
  }
}

export default News;
